import React, { useState } from 'react';
import './App.css';
import ZoomableMap from './ZoomableMap';

// Import images
import pieChartImage from './assets/pie-chart-holder.jpg';
import barChartImage from './assets/bar-graph-holder.png';

function App() {
  const [screen, setScreen] = useState('title'); // 'title', 'dashboard', 'complaint'
  const [formData, setFormData] = useState({
    category: '',
    dateTime: '',
    place: '',
    concern: ''
  });

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    alert('Complaint Submitted: ' + JSON.stringify(formData, null, 2));
    setFormData({ category: '', dateTime: '', place: '', concern: '' }); // Reset form
  };

  if (screen === 'title') {
    return (
      <div className="title-screen">
        <h1>Smart City Dashboard</h1>
        <div className="button-container">
          <button onClick={() => setScreen('complaint')} className="submit-complaint-btn">
            Submit Complaints
          </button>
          <button onClick={() => setScreen('dashboard')} className="go-dashboard-btn">
            Go to Dashboard
          </button>
        </div>
      </div>
    );
  }

  if (screen === 'complaint') {
    return (
      <div className="complaint-screen">
        <h2>Submit Your Complaint</h2>
        <form className="complaint-form" onSubmit={handleSubmit}>
          <label> Select Your Category:</label>
          <select name="category" value={formData.category} onChange={handleChange} required>
            <option value="">Select</option>
            <option value="Potholes">Potholes</option>
            <option value="Street Lights">Street Lights</option>
            <option value="Waste Collection">Waste Collection</option>
            <option value="Others">Others</option>
          </select>

          <label> Date and Time:</label>
          <input type="datetime-local" name="dateTime" value={formData.dateTime} onChange={handleChange} required />

          <label> Place:</label>
          <input type="text" name="place" value={formData.place} onChange={handleChange} placeholder="Enter location" required />

          <label> What is Your Concern?</label>
          <textarea name="concern" value={formData.concern} onChange={handleChange} placeholder="Describe your issue..." required></textarea>

          <button type="submit" className="submit-btn">Submit</button>
        </form>
        <button onClick={() => setScreen('title')} className="back-btn">Back to Home</button>
      </div>
    );
  }

  return (
    <div className="app-container">
      <h1 className="dashboard-title">Smart City Dashboard</h1>

      <div className="left-container">
        <div className="map-container">
          <div className="box map-section">
            <h2>Georgia Tech Map</h2>
            <ZoomableMap />
          </div>
        </div>
      </div>

      <div className="right-container">
        <div className="complaints-list">
          <h3>Top Issues</h3>
          <ul>
            <li><span>Potholes</span> <span className="complaint-count">20</span></li>
            <li><span>Street Lights</span> <span className="complaint-count">15</span></li>
            <li><span>Waste Collection</span> <span className="complaint-count">10</span></li>
            <li><span>Type D of complaints</span> <span className="complaint-count">5</span></li>
          </ul>
        </div>

        <div className="garbage-section">
          <div className="status-chart">
            <h3>Status</h3>
            <div className="chart-placeholder">
              <img src={pieChartImage} alt="Pie Chart" />
            </div>
          </div>
          <div className="garbage-collection-chart">
            <h3>Garbage Collection</h3>
            <div className="chart-placeholder">
              <img src={barChartImage} alt="Bar Chart" />
            </div>
          </div>
          <div className="garbage-collection-chart">
            <h3>Garbage Collection</h3>
            <div className="chart-placeholder">
              <img src={barChartImage} alt="Bar Chart" />
            </div>
          </div>
        </div>
      </div>

      <button onClick={() => setScreen('title')} className="back-home-btn">
        Back to Home
      </button>
    </div>
  );
}

export default App;
